import { createMuiTheme } from '@material-ui/core/styles';
import bg from '../assets/images/5150.jpeg';


const theme = createMuiTheme({
  palette: {
    primary: {
      main: "#D4AF37",
      contrastText: "#fff"
    },
    background: {
      default: "#FAFFCC"
    }
  },
  backgroundImage: `url(${bg})`
})

export default theme;
